import React, { useEffect, useState } from "react";

const RateList = (props) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    setData(props.data);
  }, [props.data]);
  return (
    <div className="row">
      {(data || []).map((e) => (
        <>
          <div className="col-xl-2 col-md-2 col-sm-2 d-block m-auto w-25">
            <img
              className="rounded-circle"
              src="https://cdn-icons-png.flaticon.com/512/147/147144.png"
              alt=""
            />
          </div>
          <div className="col-xl-10 col-md-10 col-sm-10">
            <div>
              {" "}
              <i className="fas fa-star  text-warning"></i>
              <i className="fas fa-star  text-warning"></i>
              <i className="fas fa-star  text-warning"></i>
              <i className="fas fa-star  text-warning"></i>
              <i className="fas fa-star  text-warning"></i>
              <span className="ms-3">
                <small className="fw-bold">Trần văn C</small>{" "}
              </span>{" "}
            </div>

            <p>
              Giá tiền đi đôi với chất lượng: + Máy đẹp, ngon nghẻ + Các bạn
              nhân viên tư vấn nhiệt tình và đúng theo yêu cầu khách hàng, không
              phải kiểu dí khách mua máy như một số bên khác. Mua cho nhiều anh
              em bạn bè máy ở đây rồi đến giờ vẫn chưa gặp vấn đề gì!
            </p>
            <b>19/07/2020 20:06</b>
            <hr />
          </div>
        </>
      ))}
    </div>
  );
};

export default RateList;
